$_MODULE['<{supercheckout}prestashop>supercheckout_99454524f58d75bc69142c51db698004'] = "Os módulos de terceiros são feitos apenas para check -out padrão do PrestaShop. Eles podem ou não funcionar com nosso módulo. Caso eles não estejam trabalhando com nosso módulo, são necessárias algumas mudanças personalizadas para torná -las compatíveis com o nosso módulo.";
$_MODULE['<{supercheckout}prestashop>supercheckout_89b45d262a3b8d997d082e81abca5a2d'] = "6. Quer que implementemos algum recurso específico para um custo adicional?";
$_MODULE['<{supercheckout}prestashop>supercheckout_a074e8c20a65c62c9e5187271f4d5124'] = "Sim, você pode entrar em contato conosco com requisitos completos. Se as alterações forem viáveis, podemos implementá -las por um custo adicional.";
