$_MODULE['<{supercheckout}prestashop>supercheckout_5ed215b5ee0001f041ae4c9a287a5517'] = "9. O texto traduzido não está refletindo no lado da frente?";
$_MODULE['<{supercheckout}prestashop>supercheckout_08ca6a947fc70d8babef7f7ec6aeb024'] = "Por favor, tente novamente depois de limpar seu cache de Prestashop usando o Parâmetro Avançado-> Performance-> Botão de cache transparente. Se o seu problema persistir mesmo depois disso, verifique se o seu diretório de temas não conterá nosso arquivo de tradução do módulo. Para verificar isso, vá para o seu diretório de temas";
$_MODULE['<{supercheckout}prestashop>supercheckout_3c82d67a74d281ef174bf95b12c24a8a'] = "Dentro deste diretório de módulos, não deve haver diretório de supercocencheto, caso exista apenas renomeie -o para qualquer outra coisa.";
$_MODULE['<{supercheckout}prestashop>supercheckout_a6f90da86996e1221fda518644259beb'] = "Quando você traduz o texto do painel de administração do módulo, nosso módulo salva o texto traduzido em";
$_MODULE['<{supercheckout}prestashop>supercheckout_d7529a65fb108570a2aed2400414c23d'] = "Mas quando existe alguma tradução no seu diretório de temas, nosso módulo escolhe o texto de lá e seu texto traduzido não reflete na frente.";
$_MODULE['<{supercheckout}prestashop>supercheckout_bf4ad7ba59bbead463e5e2139692e642'] = "Agora, surgem a pergunta, nesse caso, o diretório de temas pode fazer com que nosso módulo traduza o arquivo de texto.";
$_MODULE['<{supercheckout}prestashop>supercheckout_0787d403d8b13efef7fe01c7abe369d7'] = "Quando você usa o recurso de tradução padrão do PrestaShop, ele salva o texto traduzido no diretório de temas e nosso módulo use o texto deste diretório de temas, em vez de usar o texto no diretório do módulo.";
$_MODULE['<{supercheckout}prestashop>supercheckout_2c82c4b35996db294c4abb8e159fe18b'] = "10. A imagem do método de pagamento não está chegando?";
